import "../UI/Card.css"

function card(props){
    const clas =  "card " + props.className
   return <div className={clas}>{props.children}</div>
}

function card1(props){
    const clas =  "card1 " + props.className
   return <div className={clas}>{props.children}</div>
}

export default card
